import React from 'react';
import HotelJson from './hotelJson.js'
import Form from '../../../../General/Form/form.js'

class HotelForm extends React.Component{
  render() {
    const hotelForm = HotelJson.map(oneitem =>
      <Form item={oneitem}/>)
    return (
      <div>
      {hotelForm}
      </div>
    );
  }
}
export default HotelForm
